export function SimpleNavigator(props) {
    return (
        <section>
            <ul className="list-group p-0">
                {props.childrens}
            </ul>
        </section>
    )
};

export function SimpleNavigatorItem(props) {
    return (
        <li>{props.childrens}</li>
    )
};
